#include <iostream>
#include <map>
#include <vector>
#include <chrono>

using namespace std;

class Solution {
    map<int,int,std::greater<int>> left;
    map<int,int,std::greater<int>> right;

public:
    Solution () : left(map<int,int,std::greater<int>>()), right(map<int,int,std::greater<int>>()) {}

    vector<int> resultArray(vector<int>& nums) {
        int length = nums.size();
        int ret_left[100000];
        int ret_right[100000];
        int leftSize=0;
        int rightSize=0;
        if (length < 3)
            return vector<int>();

        left[nums[0]] = 1;
        right[nums[1]] = 1;
        ret_left[leftSize++] = nums[0];
        ret_right[rightSize++] = nums[1];

        /* Timing */
        using std::chrono::high_resolution_clock;
        using std::chrono::duration_cast;
        using std::chrono::duration;
        using std::chrono::microseconds;
    
        for (int i = 2; i < length; ++i) {
            auto t1 = high_resolution_clock::now();

            int leftS = greaterCount(left, nums[i]);
            int rightS = greaterCount(right, nums[i]);
            
            auto t2 = high_resolution_clock::now();
            auto ms_int = duration_cast<microseconds>(t2 - t1);
            if (leftS > rightS) {
                ret_left[leftSize++] = nums[i];
                left[nums[i]]++;
            } else if (leftS < rightS) {
                ret_right[rightSize++] = nums[i];
                right[nums[i]]++;
            } else if (leftS==rightS) {
                if (leftSize < rightSize) {
                    ret_left[leftSize++] = nums[i];
                    left[nums[i]]++;
                } else if (leftSize > rightSize) {
                    ret_right[rightSize++] = nums[i];
                    right[nums[i]]++;
                } else {
                    ret_left[leftSize++] = nums[i];
                    left[nums[i]]++;
                }
            }
            cout<<"iteration " << i << " took "<< ms_int.count() << " " << endl;
        }

        vector<int> ret(ret_left,ret_left+leftSize);
        vector<int> tmpR(ret_right,ret_right+rightSize);
        ret.insert(ret.end(), tmpR.begin(), tmpR.end());
        return ret;
    }

    int greaterCount(map<int,int,std::greater<int>> mm, int val) {
        int ret = 0;
        for (auto m : mm) {
            if (m.first>val)
                ret += m.second;
            else
                break;
        }
        return ret;
    }
};


